import "./style/Page.css"

const Page = (props) => {
    return (
        <>
            <div id="home-page-container">
                <div id="profile-img">
                    <img src={require("./../images/profile/profile.jpg")} />
                </div>
            </div>
        </>
    )
}

export default Page;
